addPhetioElementAddedListener.documentation:
Adds a listener that receives a callback when a PhET-iO Element has been added.Arguments for the function: 
<ul><li><strong>phetioID:</strong> {String}
</li><li><strong>metadata:</strong> {Object} - element specific metadata like documentation and type, see PhetioEngineIO.getPhetioElementMetadata().</li><li><strong>state:</strong> {Object} - a snapshot of the initial state of the PhET-iO Element.</li></ul>
